style.css:
@-moz-document domain("habblet.city") {
/* Remover o primeiro anúncio */
  #ads1 {
    display: none !important;
  }

  /* Remover o segundo anúncio */
  #ads2 {
    display: none !important;
  }

  /* Remover o terceiro anúncio */
  #ads3 {
    display: none !important;
  }

  /* Ocultar a div com ID card */
  #card {
    display: none !important;
  }

  /* Ocultar todos os elementos <ins> com as classes adsbygoogle e adsbygoogle-noablate */
  ins.adsbygoogle.adsbygoogle-noablate {
    display: none !important;
  }
  
  /* Ocultar todos os elementos adsbygoogle e adsbygoogle-noablate */
  .adsbygoogle.adsbygoogle-noablate {
    display: none !important;
  }


  /* Posicionar o elemento adsbygoogle */
  .adsbygoogle {
    display: none !important;
  }
}
